function UrlHelper(url) {

    if (typeof url === 'undefined')
        this.url = window.location.href;

    this.getURL = function () {
        var index = this.url.indexOf('?');
        var urlString = index > 0 ? this.url.substring(0, index) : this.url;
        var params = '';
        for (var key in this.queryString) {
            if (key !== '') {
                params += '&' + key + '=' + this.queryString[key];
            }
        }

        return decodeURIComponent(params == '' ? urlString : urlString + '?' + params.substring(1));
    };

    this.queryString = {};

    var query = window.location.search.substring(1);

    if (typeof url !== 'undefined') {
        var index = url.indexOf('?');
        var length = url.length;
        query = index > 0 ? url.substring(index + 1, url.length) : '';
        this.url = url;
    }

    var vars = query.split('&');
    for (var i = 0; i < vars.length; i++) {
        var pair = vars[i].split('=');
        if (typeof this.queryString[pair[0]] === 'undefined') {
            this.queryString[pair[0]] = decodeURIComponent(pair[1]);
        } else if (typeof this.queryString[pair[0]] === 'string') {
            var arr = [this.queryString[pair[0]], decodeURIComponent(pair[1])];
            this.queryString[pair[0]] = arr;
        } else {
            this.queryString[pair[0]].push(decodeURIComponent(pair[1]));
        }
    }
};

UrlHelper.prototype.removeParameter = function (param) {
    if (this.queryString[param] !== undefined) {
        delete this.queryString[param];
    }
};

UrlHelper.prototype.getParameter = function (param) {
    return this.queryString[param];
};

UrlHelper.prototype.addParameter = function (key, value) {
    this.queryString[key] = value;
};

UrlHelper.prototype.hasParameter = function (param) {
    return this.queryString[param] === undefined ? false : true;
};;
