function persistListDesingViewype(viewType) {
    var currentViewType = window.localStorage.getItem('viewType');
    if (viewType) {
        if (currentViewType !== viewType) {
            window.localStorage.setItem('viewType', viewType);
        }
    } else if (currentViewType !== viewType) {
        if (currentViewType === "colMode") {
            switchListDesignCol();
        }

        if (currentViewType === "rowMode") {
            switchListDesignRow();
        }

        if (currentViewType === "colModePopup") {
            switchListDesignColPopUp();
        }

        if (currentViewType === "rowModePopup") {
            switchListDesignRowPopUp();
        }
    }

}
