var magiczoomIndex = 1;
function magiczoomMove(pDirection) {
    var count = $(".thumbnails").children().length;

    if (pDirection === "forward") {
        magiczoomIndex = magiczoomIndex + 1;
        if (magiczoomIndex > count) {
            magiczoomIndex = 1;
        }
    } else {
        magiczoomIndex = magiczoomIndex - 1;
        if (magiczoomIndex < 1) {
            magiczoomIndex = count;
        }
    }

    var src = $(".thumbnails .thumbnail:nth-child(" + magiczoomIndex + ") a img").attr("src")
    MagicZoom.update('product', src, src, 'show-title: false');
}

