function SelectSizeChange(element) {
    //Get values fron page
    var index = element.selectedIndex;
    var packSize = element.options[index].value;
    var prodid = element.options[index].dataset.prodid;

    var jsonModel = document.getElementById("jsonModel");
    var model = JSON.parse(jsonModel.innerHTML);

    var product = model.filter(function (el) {
        return el.ProductID === prodid;
    });

    var productVariant = product[0].Variants.filter(function (el) {
        return el.VariantPackSize == packSize;
    });

    var CodeIDClass = "ProductCode-" + prodid;
    var PriceIDClass = "ProductPrice-" + prodid;
    var PorIDclass = "ProductPOR-" + prodid;

    var trolleyQuantityCellClass = "ProductTrolleyQuantity-" + prodid;
    var trolleyQuantityCell = $("." + trolleyQuantityCellClass);
    trolleyQuantityCell.each(function (index, td) {
        var $td = $(td);
        $quantityDivWrapper = $td.find("div.quantity");
        if ($quantityDivWrapper) {
            if ($quantityDivWrapper.data('containerproductcode') == productVariant[0].Code) {
                $td.removeClass('hidden');
            } else {
                $td.addClass('hidden');
            }
        }
    });

    $('.' + CodeIDClass).html(productVariant[0].OwnCode);
    $('.' + PriceIDClass).html(productVariant[0].Price);
    $('.' + PorIDclass).html(productVariant[0].POR);
}

