// Restricts input for the set of matched elements to the given inputFilter function.
(function ($) {
    $.fn.inputFilter = function (inputFilter) {
        return this.on("input keydown keyup mousedown mouseup select contextmenu drop", function () {
            if (inputFilter(this.value)) {
                this.oldValue = this.value;
                this.oldSelectionStart = this.selectionStart;
                this.oldSelectionEnd = this.selectionEnd;
            } else if (this.hasOwnProperty("oldValue")) {
                this.value = this.oldValue;
                this.setSelectionRange(this.oldSelectionStart, this.oldSelectionEnd);
            } else {
                this.value = "";
            }
        });
    };
}(jQuery));

// Booker Youtube Video embed
var ytVideos = (function () {
    // VARIABLES
    var $ = jQuery,
        players = [],
        queue = [],
        ytPlaying = 0,
        ytPlayed = '',
        currPlaying = '';

    // Constructor
    function Videos() { }

    // METHODS
    // Add elements to queue
    Videos.prototype.add = function ($video) {
        queue.push($video);
    };

    // Load YT API
    Videos.prototype.loadApi = function () {
        // jQuery get script
        $.getScript("//www.youtube.com/iframe_api", function () {
            // once loaded, create the onYouTubeIframeAPIReady function
            window.onYouTubeIframeAPIReady = function () {
                queue.forEach(function ($video) {
                    // Create the YT player
                    var player = new YT.Player($video.get(0), {
                        'width': $video.data("video-width"),
                        'height': $video.data("video-height"),
                        'videoId': $video.data("video-id"),
                        playerVars: {
                            'playsinline': 1,
                            'rel': 0,
                            'controls': 0,
                            'autoplay': $video.data("video-autoplay"),
                            'loop': $video.data("video-loop"),
                            'playlist': $video.data("video-id")
                        },
                        events: {
                            'onStateChange': onPlayerStateChange
                        }
                    });
                    // add to players array
                    players.push(player);
                });
            };
        });
    };

    function onPlayerStateChange(event) {
        var video = event.target.getVideoData();
        if (event['data'] === 1) {
            console.log('Play ' + video['video_id'])
            ytTracking(video)
        }

    }

    function ytTracking(video) {
        if (video['video_id'] != ytPlayed) {
            // API endpoint goes here
            var campaignDiv = $(".video-campaign-" + video['video_id']);
            var campaignId = campaignDiv.data('campaignid');

            if (campaignId) {
                var payload = {
                    Type: "VIDEOPLAY",
                    Referer: window.location.pathname+window.location.search,
                    CampaignId: campaignId,
                    PageId: campaignDiv.data('pageid'),
                    DatasourceId: campaignDiv.data('datasourceid'),
                    RenderingId: campaignDiv.data('renderingid')
                };

                $.ajax({
                    url: '/api/booker/analytics/registerevent',
                    type: 'POST',
                    dataType: "json",
                    contentType: 'application/json',
                    data: JSON.stringify(payload)
                }).done(function (data) {
                    console.log(data);
                });
            }
        }
        ytPlaying = 0;
        ytPlayed = video['video_id'];
    }

    return Videos;

})();

